import Carousel from 'react-bootstrap/Carousel';
import "./carousssel.css"

export default function UncontrolledExample() {



  return (
    
    <div>
   {caroussel.map((caroussels ,index)=> {

  return (
     
     <div key={index}>

    <Carousel className='caroussel'>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={caroussels.img}
        />
        <Carousel.Caption>
          <h3>{caroussels.title}</h3>
        </Carousel.Caption>
      </Carousel.Item>
</Carousel>
</div>
  );
})}
</div>
  );
}
